import * as React from 'react';
import { AppBar, Toolbar, Typography, Menu, MenuItem } from '@mui/material';
import { styled } from '@mui/system';
import PopupState, { bindTrigger, bindMenu } from 'material-ui-popup-state';

// Define estilos para los elementos de menú
const StyledMenuItem = styled(MenuItem)({
  padding: '8px 16px',
  '&:hover': {
    backgroundColor: '#d3d3d3',
  },
});

const DashboardNavBar = () => {
  return (
    <AppBar position="static" color="primary">
      <Toolbar>
        {/* Código del menú para clientes */}
        <PopupState variant="popover" popupId="clientes-popup-menu">
          {(popupState) => (
            <React.Fragment>
              <Typography variant="h6" color="inherit" noWrap {...bindTrigger(popupState)}>
                Clientes
              </Typography>
              <Menu {...bindMenu(popupState)}>
                <StyledMenuItem onClick={popupState.close}>Agregar Cliente</StyledMenuItem>
              </Menu>
            </React.Fragment>
          )}
        </PopupState>

        {/* Código del menú para servicios */}
        <PopupState variant="popover" popupId="servicios-popup-menu">
          {(popupState) => (
            <React.Fragment>
              <Typography variant="h6" color="inherit" noWrap {...bindTrigger(popupState)}>
                Servicios
              </Typography>
              <Menu {...bindMenu(popupState)}>
                <StyledMenuItem onClick={popupState.close}>Agregar Servicio</StyledMenuItem>
              </Menu>
            </React.Fragment>
          )}
        </PopupState>

        {/* Código del menú para profesionales */}
        <PopupState variant="popover" popupId="profesionales-popup-menu">
          {(popupState) => (
            <React.Fragment>
              <Typography variant="h6" color="inherit" noWrap {...bindTrigger(popupState)}>
                Profesionales
              </Typography>
              <Menu {...bindMenu(popupState)}>
                <StyledMenuItem onClick={popupState.close}>Agregar Profesional</StyledMenuItem>
              </Menu>
            </React.Fragment>
          )}
        </PopupState>
      </Toolbar>
    </AppBar>
  );
};

export default DashboardNavBar;
